import React, { useState, useEffect } from "react";
import Header from "./component/header";
import SearchItems from "./component/header/SearchItems";
import SearchBars from "./component/header/SearchBars";
import Container from "@material-ui/core/Container";
import "./App.css";
import axios from "axios";

/*async function getPostData() {
  const jsonData = await axios.get("https://jsonplaceholder.typicode.com/users")

  console.log(jsonData.data)
}

getPostData()*/

function App() {
  /* const getPostData = () => {
    axios
    .get("https://jsonplaceholder.typicode.com/users")
    .then(jsonData => console.log(jsonData.data))
    .catch(error => console.log(error));

  };
  getPostData(); */

  //const axios = require("axios");

  // Search items to be put in list
  const [entireList, setEntireList] = useState([]);
  useEffect(() => {
    function getPostData() {
      axios
      .get("https://jsonplaceholder.typicode.com/users")
      .then(jsonData => {setEntireList(jsonData.data); console.log(jsonData.data);})
      .catch(error => console.log(error))};
  });


  return (
    <div className="App">
      <Header />
      <SearchBars />
      <Container fixed>
        <SearchItems list={entireList} />
      </Container>
    </div>
  );
}

export default App;
